import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { registerAuthServiceWorker } from './services/authServiceWorker';

// Register the auth service worker
if (process.env.NODE_ENV === 'development') {
  registerAuthServiceWorker().then(registration => {
    console.log('Auth Service Worker registered:', registration);
  }).catch(error => {
    console.error('Failed to register Auth Service Worker:', error);
  });
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
